-- ----------------------------
--  Table structure for `cb_user`
-- ----------------------------
DROP TABLE IF EXISTS `cb_user`;
CREATE TABLE `cb_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `mobile` varchar(16) DEFAULT '' COMMENT '用户手机号',
  `user_name` varchar(255) DEFAULT '' COMMENT '昵称（设计特殊字符可存之前转义一下）',
  `reg_time` datetime DEFAULT '2018-02-11 00:00:00',
  `avatar` varchar(255) DEFAULT '' COMMENT '用户头像',
  `city` varchar(20) DEFAULT '' COMMENT '城市',
  `province` varchar(20) DEFAULT '' COMMENT '省份',
  `gender` varchar(10) DEFAULT 'M' COMMENT '性别',
  `idcard` varchar(64) DEFAULT '',
  `really_name` varchar(128) DEFAULT '',
  `invite_code` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `mobile` (`mobile`)
) ENGINE=InnoDB AUTO_INCREMENT=1607 DEFAULT CHARSET=utf8;

